import React from "react";
import logo from './../logo.svg';
import Topbar from "./Topbar";
import MiddleSection from "./MiddleSection";
import Footer from "./Footer";
import { RouteFiles } from "../Routes/RouteFiles";


function Layout(){
return(
    <>
       <Topbar/>
      <RouteFiles />
       <Footer/>
    </>
);
}
export default Layout;
